import './App.css';
import React from 'react';
import styles from './App.css';
function App() {
  return (
    <div className='App'>
        <div className="parent">
            <div className="header"><h1>E-Wardrobe</h1></div>
            <div className="body">
                <div className="parent">
                    <div className="mainhat"></div>
                    <div className="mainshirt"></div>
                    <div className="mainpants"></div>
                    <div className="mainshoes"></div>
                    <div className="div5"></div>
                    <div className="div6"></div>
                    <div className="div7"></div>
                    <div className="div8"></div>
                    <div className="div9"></div>
                    <div className="div10"></div>
                    <div className="div11"></div>
                    <div className="div12"></div>
                </div>
            </div>
            <div className="left">GAUCHE</div>
            <div className="right">DROITE</div>
        </div>
        <button onClick={addItem}>Add a clothe</button>
    </div>
  );
}

function addItem(){
    alert("Do you really want to add a clothe in your  E-Wardrobe ?")
}
export default App;
